INSERT INTO `book` (`id`, `title`, `description`, `releasedate`, `genre`, `img`, `language`, `authorid`, `publisher`, `amount`, `isbn`) VALUES
(1, 'Ulysses', 'Az Ulysses a főszereplő, Leopold Bloom dublini történetét meséli egy teljesen hétköznapi napon, 1904. június 16-án. A cím Homérosz, ókori görög költő Odüsszeia című Kr. e. 8. századi eposzára utal. Odüsszeusz nevének latin megfelelője Ulysses. Rejtett és álcázatlan párhuzamokat fedezhetünk fel a két mű között. Leopold Bloom felel meg Odüsszeusznak, Molly Bloom (a feleség) Pénelopénak és Stephen Dedalus (a fiú) Télemakhosznak. Június 16-át, a főhős történetének napját, a Joyce-rajongók világszerte Bloom napjaként (Bloomsday) ünneplik. ', '1918-01-01', 'Regény', , 'hu', 1, 'Európa Könyvkiadó', 15, '963-07-0419-6');
INSERT INTO `book` (`id`, `title`, `description`, `releasedate`, `genre`, `img`, `language`, `authorid`, `publisher`, `amount`, `isbn`) VALUES
(2, 'Dublini emberek', 'A történet akkor játszódik, amikor az ír nacionalizmus tetőfokára hágott. Írország ekkoriban erős kulturális megújuláson ment keresztül, felfrissítve saját történelmi múltját, irodalmi értékeit, új eszméket teremtve az új évszázadban. Minden történet a Joyce által kedvelt „epifánia” köré fonódik, amely olyan pillanatot jelent, amikor a szereplő egy különleges pillanat következtében megvilágosodik, és megérti saját helyzetét. A Dublini emberek több szereplője feltűnik Joyce Ulysses című regényében is.', '1914-01-01', 'Novella', , 'hu', 1, 'Európa Könyvkiadó', 0, '963-613-030-2');
INSERT INTO `book` (`id`, `title`, `description`, `releasedate`, `genre`, `img`, `language`, `authorid`, `publisher`, `amount`, `isbn`) VALUES
(3, 'Don Quijote', 'Cervantes történetének alapját egy fiktív mór történész, Cide Hamete Benengeli kézirata adta. A Don Quijote azonkívül, hogy a legnépszerűbb spanyol irodalmi munka, egyúttal a világ leghíresebb irodalmi munkái között is szerepel. A norvég Nobel intézet által végzett 2002-es Top 100 világirodalom klasszikus lista szavazáson 50%-kal több voksot kapott, mint bármely más könyv.', '1605-01-01', 'Regény', , 'sp', 2, 'Juan de la Cuesta', 1, '-');
INSERT INTO `book` (`id`, `title`, `description`, `releasedate`, `genre`, `img`, `language`, `authorid`, `publisher`, `amount`, `isbn`) VALUES
(4, 'Hamlet, dán királyfi', 'A Hamlet, dán királyfi William Shakespeare egyik legismertebb tragédiája. Ez a dráma az európai kultúra alapművei közé tartozik, könyvtárnyi irodalma, szinte számbavehetetlen feldolgozása van, és a legtöbbet idézett művek egyike.', '1589-01-01', 'Tragédia', , 'en', 3, '-', 8, '-');
INSERT INTO `book` (`id`, `title`, `description`, `releasedate`, `genre`, `img`, `language`, `authorid`, `publisher`, `amount`, `isbn`) VALUES
(6, 'Az ember tragédiája', 'A mű a Genezisben lévő teremtéstörténetet dolgozta fel és 15 színből áll.', '1862-01-01', 'Dráma', , 'hu', 4, '-', 20, '-');

